description:
'''Diana's''' [[basic attacks]] {{tip|on-hit}} grant a [[stack]] for {{fd|3.5}} seconds, stacking up to 2 times, and refreshing the duration upon receiving the second stack. At 2 stacks, '''Diana's''' next basic attack {{tip|on-hit}} consumes the stacks to additionally cleave nearby enemies, dealing them {{as|{{pp|20+5*(x-1) for 5; then + 5 + 10*x for 5; then + 10 + 15*x for 5; then + 10 + 20*x|

formula=20 + 5 per level until level 6, then + 5 once and + 10 per level until level 11, then + 10 once and + 15 per level until level 16, then +10 once and + 20 per level

}}|magic damage}} {{as|(+ 50% AP)}} {{as|magic damage}}. ''Moonsilver Blade'' deals 300% damage against non-{{tip|monster|epic monsters}}.

q1.notes:
* The tip of the arc grants {{tip|sight}} briefly.
* Even if the target {{tip|spell shield|spell shields}} the bolt, they may still be damaged by the explosion. ''Moonlight'' is not applied to the protected target if blocked.
{{Effect at cast time end}}
** If the ability is cast at max range and she is moved backwards while casting, the bolt will travel to the target location with increased distance.{{bug}}
